	(77, '2024-10-22 10:00:00', 'Anaknya udah mulai rutin lagi. Goal kedepan kalau dari kita, si Bryan mau gw tutup kakinya, banyakin IR. Makanya masuh RFE langsung.\n\nProwler kaki dia jangan sampe bebek, bilang aja, goal kita itu buat nutup pinggang dia sedikit, supaya kalau mau low, gak harus pake badan.\n\nKemungkinan nanti cuman dia yang kita bench press.', 60, 45, '2024-12-09 04:44:11', '2024-12-09 04:43:46', 3, 3),
	(78, '2024-10-28 10:00:00', '- Ball slam ingetin posisi kaki (mulai dari 2,2 posisi lompat tanpa bola). \n- Pas box split jump, stay diposisi dulu pas digaris, pinggang masuk 4x lutut jangan ikt and jump ke box.\n\n- hooklying diganti midfoot tapi ttp dua kaki.', 61, 45, '2024-12-09 05:41:57', '2024-12-09 05:38:37', 3, 3),
